    public class Solution_Dictionary
    {
        public int LengthOfLongestSubstring(string s)
        {
            if (string.IsNullOrEmpty(s))
            {
                return 0;
            }

            Dictionary<char, int> chars = new Dictionary<char, int>();//用来记录上一次出现的位置

            int longestLen = 0;
            int start = 0;
            int end = 0;
            while (end < s.Length)
            {
                if (chars.ContainsKey(s[end]))
                {
                    start = Math.Max(chars[s[end]],start);//快速地移动start的位置
                }

                chars[s[end]]=end+1;

                //longestLen = Math.Max(longestLen,end-start+1);
                if (longestLen<(end-start+1))
                {
                    longestLen = end - start + 1;
                }

                end ++;
            }

            return longestLen;
        }
    }


    public class Solution
    {
        public int LengthOfLongestSubstring(string s)
        {
            if (string.IsNullOrEmpty(s))
            {
                return 0;
            }

            HashSet<char> chars = new HashSet<char>();

            int longestLen = 0;
            int start = 0;
            int end = 0;
            while (start < s.Length && end < s.Length)
            {
                if (!chars.Contains(s[end]))
                {
                    chars.Add(s[end]);
                    end++;
                    longestLen = Math.Max(longestLen, end - start);
                }
                else
                {
                    chars.Remove(s[start]);
                    start++;
                }

            }

            return longestLen;
        }
    }


    public class Solution_Time_Limit_Exceeded
    {
        public int LengthOfLongestSubstring(string s)
        {
            if (string.IsNullOrEmpty(s))
            {
                return 0;
            }

            int longestLen = 0;
            for (int i = 0; i < s.Length; i++)
            {
                string sub = GetLongestSubStringWithoutRepeat(s, i);

                if (sub.Length > longestLen)
                {
                    longestLen = sub.Length;
                }
            }

            return longestLen;
        }

        private string GetLongestSubStringWithoutRepeat(string s, int fromIndex)
        {
            string result = s[fromIndex].ToString();

            for (int i = fromIndex + 1; i < s.Length; i++)
            {
                if (result.Contains(s[i]))
                {
                    break;
                }

                result += s[i];
            }

            return result;
        }
    }


